using System;
using System.Collections.Generic;
using System.Data.Entity;
using System.Diagnostics.CodeAnalysis;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Cinema.Domain.Features.Lounges;
using Cinema.Domain.Features.Movies;
using Cinema.Domain.Features.Sessions;
using Cinema.Domain.Features.Snacks;
using Cinema.Domain.Features.Users;
using Cinema.Infra.Crypto;

namespace Cinema.Infra.ORM.Base
{
    /// <summary>
    /// Inicializador para criar o banco de dados quando não existir. Possui um método Seed para popular o banco.
    /// </summary>
    [ExcludeFromCodeCoverage]
    public class DbInitializer : CreateDatabaseIfNotExists<BaseContext>
    {
        protected override void Seed(BaseContext context)
        {
            #region USERS
            User admin = new User
            {
                Email = "admin",
                Name = "admin",
                Password = "admin".GenerateHash(),
                Permission = EnumPermissionLevel.Admin
            };
            User employee = new User
            {
                Email = "employee",
                Name = "employee",
                Password = "employee".GenerateHash(),
                Permission = EnumPermissionLevel.Employee
            };
            User customer = new User
            {
                Email = "customer",
                Name = "customer",
                Password = "customer".GenerateHash(),
                Permission = EnumPermissionLevel.Customer
            };
            context.Users.AddRange(new List<User> { admin, employee, customer });
            #endregion

            #region LOUNGES
            Lounge lounge1 = new Lounge
            {
                Name = "Sala 1",
                Seats = 30
            };
            Lounge lounge2 = new Lounge
            {
                Name = "Sala 2",
                Seats = 30
            };
            Lounge lounge3 = new Lounge
            {
                Name = "Sala 3",
                Seats = 30
            };
            context.Lounges.AddRange(new List<Lounge> { lounge1, lounge2, lounge3 });
            #endregion

            #region MOVIES
            Movie movie = new Movie
            {
                Image = Convert.FromBase64String(""),
                Name = "JavaScript para Crianças",
                Audio = EnumAudio.Original,
                Animation = EnumAnimation._3D,
                Description = "Aqui você encontra uma série de atividades para mergulhar no mundo dos códigos.",
                Length = 90
            };

            context.Movies.Add(movie);
            #endregion

            #region SNACKS
            Snack snack1 = new Snack()
            {
                Name = "Fanta Uva",
                Price = 5,
                Image = Convert.FromBase64String("")
            };
            Snack snack2 = new Snack()
            {
                Name = "Batatinha Frita",
                Price = 16.5,
                Image = Convert.FromBase64String("")
            };
            Snack snack3 = new Snack()
            {
                Name = "Pipoca",
                Price = 150,
                Image = Convert.FromBase64String("")
            };
            context.Snacks.AddRange(new List<Snack>() { snack1, snack2, snack3 });
            #endregion

            #region SESSIONS
            for (int i = 0; i < 7; i++)
            {
                Session session = new Session
                {
                    Start = DateTime.Now.AddDays(i).AddHours(1),
                    Price = 5,
                    MovieId = 1,
                    LoungeId = 1,
                    Movie = movie,
                    Lounge = lounge1,
                    End = DateTime.Now.AddDays(i).AddMinutes(movie.Length + 1)
                };
                context.Sessions.Add(session);
            }
            
            #endregion
        }
    }
}
